import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on the cart element
    await page.waitForSelector('.cart');
    await page.click('.cart');

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { state: 'visible' });

    // Take screenshot of opened cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract cart data to verify the modal is open
    const cartData = await page.evaluate(() => {
      const modal = document.getElementById('cartModal');
      const items = document.querySelectorAll('.cart-item');
      const total = document.getElementById('cartTotal');

      return {
        modalVisible: modal && window.getComputedStyle(modal).display !== 'none',
        itemCount: items.length,
        totalAmount: total ? total.textContent : null
      };
    });

    return {
      success: true,
      action: "Successfully opened shopping cart modal",
      extractedData: cartData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open shopping cart modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
